import React, {useState} from "react"; 
import { Form, Button } from "react-bootstrap";
import 'react-phone-number-input/style.css'
import PhoneInput from 'react-phone-number-input'

function FormSet (props) {
  let LastInput;
  const [value, setValue] = useState()

  if (props.PhoneNumberInput == "true") {
    LastInput = <Form.Group className="mb-3" controlId="formBasicFeedback">
                  <Form.Label>PHONE NUMBER</Form.Label>
                  <PhoneInput
                    className="Input"
                    placeholder="Enter phone number"
                    value={value}
                    onChange={setValue}  
                  />
                </Form.Group>
  } else {
    LastInput = <Form.Group className="mb-3" controlId="formBasicFeedback">
                  <Form.Label>{props.ThirdInput}</Form.Label>
                  <input className="Input BigTextInput" type="text" placeholder="Type..."/>
                </Form.Group>
  }

  return (
      <Form style={{color:"#E4EFE7"}}>
        <h2 className="MdFont CursiveFont LightGreenFontShade">{props.Title}</h2>

        <Form.Group className="mb-3" controlId="formBasicName">
          <Form.Label>{props.FirstInput}</Form.Label>
          <Form.Control className="InputFocusGreen" type="text" placeholder="Enter your name" />
        </Form.Group>

        <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label>{props.SecondInput}</Form.Label>
          <Form.Control className="InputFocusGreen" type="email" placeholder="Enter your email id" />
        </Form.Group>

        {LastInput}

        <Button className="ButtonStyle" variant="primary" type="submit">Submit</Button>
      </Form>
    );
}

export default FormSet;
